INSERT INTO `tbl_nilai` (`Id`, `proposal_id`, `user_id`, `original`, `inovasi`, `kolaborasi`, `kebermanfaatan`, `sustainability`, `TTKI`, `video`, `komentar`, `anggaran`, `created_at`, `updated_at`) VALUES
(11, 71, 27, 70, 140, 75, 175, 100, 50, 1, 'Perlu perbaikan roadmap, dimana periode waktunya adalah jangka panjang, bukan jangka pendek. Misalnya tahun pertama apa milestonenya, tahun kedua, ketiga dan seterusnya', '19.000.000', '2020-10-14 04:11:29', '2020-10-14 04:11:29'),
(13, 83, 27, 10, 20, 15, 25, 20, 10, 0, 'Proposal dan video kosong', '0', '2020-10-14 04:21:39', '2020-10-14 04:21:39'),
(14, 107, 27, 10, 20, 15, 25, 20, 10, 0, 'Proposal dan video kosong, konsep tidak dijabarkan secara detail', '0', '2020-10-14 04:29:14', '2020-10-14 04:29:14'),
(15, 88, 27, 60, 140, 75, 175, 140, 60, 1, 'Tambahkan sesi pelatihan menjadi 3 kali, diantaranya pelatihan mengenai pengembangan bisnis, tambahkan anggota tim dengan bidang keilmuan yang sesuai', '18.000.000', '2020-10-14 04:33:36', '2020-10-14 04:33:36'),
(16, 54, 27, 50, 140, 75, 150, 60, 50, 1, 'Lanjutkan', '17.000.000', '2020-10-14 04:55:28', '2020-10-14 04:55:28'),
(17, 119, 27, 70, 140, 105, 175, 100, 60, 1, 'Optimalkan perencanaan pemasaran digital, dengan alokasi dana yang ditambahkan.', '24.000.000', '2020-10-14 05:48:38', '2020-10-14 05:48:38'),
(18, 74, 18, 10, 60, 15, 50, 20, 20, 1, 'Orisinalitas ide/gagasan rendah dan kurang identifiable.\r\nKooperasi dan koordinasi antardisiplin ilmu tidak disampaikan dengan jelas.\r\nSustainability rendah. \r\nKebermanfaatan dan sinergi kurang.', 'N/A', '2020-10-14 05:51:54', '2020-10-14 05:51:54'),
(19, 103, 18, 10, 20, 15, 50, 20, 10, 1, 'Orisinalitas ide/gagasan rendah dan kurang identifiable.\r\nKooperasi dan koordinasi antardisiplin ilmu tidak disampaikan dengan jelas.\r\nSustainability rendah. \r\nKebermanfaatan dan sinergi kurang.', 'N/A', '2020-10-14 05:55:25', '2020-10-14 05:55:25'),
(21, 23, 27, 50, 140, 75, 150, 100, 60, 0, '- Tambahkan anggota dari bidang keilmuan yang sesuai (Digital Marketing, Branding dsj)\r\n- Perlu perbaikan rencana branding dan pemasaran secara digital\r\n- Perlu perbaikan roadmap, dimana roadmapnya jangka panjang, bukan jangka pendek\r\n- Dengan penambahan anggaran, buat rencana Pemasaran Digital dan Branding yang sesuai dengan kebutuhan', '19.000.000', '2020-10-14 16:18:12', '2020-10-14 16:18:12'),
(22, 4, 20, 30, 100, 75, 125, 100, 50, 1, 'Rancangan desain tidak ditemukan.\r\nRAB kurang detil. Bahan apa saja yang diperlukan? Berapa unit produk yang akan dihasilkan?\r\nSebaiknya anggaran dimaksimalkan untuk produk, bukan untuk operasional dan honor.\r\nTidak jelas inovasi facemask seperti apa yang ditawarkan.', 'Tergantung dari bahan facemask, namun anggaran disarankan cukup 5 juta, dan sebagian besar dioptimalkan untuk memproduksi facemask sebanyak sekian pieces.', '2020-10-14 19:37:55', '2020-10-14 19:37:55'),
(23, 16, 20, 30, 100, 75, 125, 100, 50, 1, 'Rancangan toolkit dan P3K yang dimaksud tidak ditemukan dalam proposal maupun video.\r\nBiaya tidak dirinci dengan baik, sehingga tidak jelas apa yang akan dibuat.\r\nDari 20jt yang diajukan, 16jt untuk peralatan penunjang. Seharusnya dijelaskan peralatan penunjang apa yang dimaksud.\r\nTidak ada biaya bahan, sehingga tidak jelas apa yang akan dibuat.', 'Peralatan penunjang tidak jelas.', '2020-10-14 19:42:19', '2020-10-14 19:42:19'),
(24, 23, 20, 70, 140, 90, 175, 140, 70, 0, 'Pastikan untuk mengukur keberhasilan kegiatan ini dengan membandingkan, misalnya omzet penjualan kopi antara sebelum dan sesudah.', 'OK', '2020-10-14 19:51:51', '2020-10-14 19:51:51'),
(25, 28, 20, 30, 100, 75, 125, 100, 30, 1, 'Judul mengenai teknik penjemuran, tetapi isi proposal mengenai pengemasan produk.\r\nProposal membingungkan dan tidak ditulis dengan baik.', 'Biaya bahan 10 meter tidak jelas apa yang dimaksud.', '2020-10-14 20:04:59', '2020-10-14 20:04:59'),
(26, 35, 20, 70, 140, 105, 175, 140, 70, 1, 'Video menarik. Ide menarik.\r\nDipersiapkan juga bagaimana mengukur keberhasilan/kemanfaatan platform tersebut, sebelum dan sesudah platform diimplementasikan.', 'OK', '2020-10-14 20:44:08', '2020-10-14 20:44:08'),
(27, 40, 20, 70, 140, 105, 175, 140, 70, 1, 'Proposal baik, masalah dan rancangan solusi jelas, RAB rinci dan jelas.', 'Harus dipastikan apakah anggaran yang diajukan sudah mencukupi. Bila perlu ditambah.', '2020-10-14 20:49:03', '2020-10-14 20:49:03'),
(28, 47, 20, 60, 140, 90, 175, 140, 70, 1, 'Solusi menarik, bermanfaat untuk mitra sasar, namun latar belakang keilmuan pengusul tidak sesuai dengan solusi yang ditawarkan.', 'Biaya paket mohon dirinci lebih jelas. Paket Arduino 5jt yang seperti apa yang dimaksud?\r\nBiaya instalasi hidroponik apakah biaya personil/honor/upah?', '2020-10-14 20:59:31', '2020-10-14 20:59:31'),
(29, 52, 20, 60, 140, 105, 175, 140, 70, 0, 'Link video ada, tapi tidak menjelaskan proposal.\r\nUntuk memasarkan potensi pariwisata, sebaiknya dioptimalkan juga media digital lainnya, seperti instagram, dan digital marketing.\r\nPerlu dilakukan evaluasi terhadap solusi yang diimplementasikan, antara sebelum dan sesudah implementasi.', 'OK', '2020-10-14 22:31:33', '2020-10-14 22:31:33'),
(30, 59, 20, 60, 140, 105, 175, 140, 60, 1, 'Solusi dapat diterapkan, namun perlu diukur kebermanfaatannya dengan membandingkan kondisi sebelum dan sesudah solusi diimplementasikan.', 'Pupuk, pipa paralon, benih, tidak relevan dengan solusi yang ditawarkan.\r\nBiaya marketing tidak jelas kegunaannya.', '2020-10-14 22:48:39', '2020-10-14 22:48:39'),
(31, 64, 20, 60, 100, 90, 150, 120, 30, 0, 'Link video ada tapi tidak bisa diakses.\r\nProposal tidak lengkap, tidak ada RAB.\r\nPermasalahan dan target masyarakat pengguna manfaat tidak jelas.', 'RAB tidak ditemukan.', '2020-10-15 00:21:40', '2020-10-15 00:21:40'),
(32, 71, 20, 60, 120, 90, 150, 140, 60, 1, 'Video dibuat dengan baik dan menarik.\r\nMengajukan pembuatan website, namun tidak jelas konten dan fitur website untuk apa, dan untuk menyelesaikan permasalahan apa.\r\nSeandainya lolos, dibuat pengukuran keberhasilan/kemanfaatan sebelum dan sesudah website diimplementasikan.', 'OK', '2020-10-15 00:27:24', '2020-10-15 00:27:24'),
(33, 6, 22, 50, 60, 45, 74, 60, 30, 1, 'digitalisasi yang ditemakan pada sayarat innovillage, masih belum terlihat. perlu adanya unsur teknologi yang bisa jadi pelengkap abdimas ini, tjan pemberdayaan masayarakat sekitar sudah baik.', 'anggran dipengadaan alat masih mendominasi, sehingga biaya sangat besar di alokasi alat tersebut. unsur pendukung seperti digitalisasi, atau power of sosmed dan lainnya masih belum terlihat.', '2020-10-15 02:30:40', '2020-10-15 02:30:40'),
(34, 13, 22, 50, 100, 45, 74, 100, 30, 1, 'ide dan gagasan cukup baik, hanya saja perlu adanya penunjang yang ada kaitannya dengan Digitalisasi, sehingga ada ide dari pemamfaatan sampah akan lebih manfaat dan mudah diaplikasikan, baik secara berkelompok maupun perorangan.', 'anggran lebih mengalokasikan ke pembiayaan pembuatan alat saja, kebutuhan utama untuk pengenalan ke masayarakat serta pengenalan produk belum teralokasikan.', '2020-10-15 02:50:55', '2020-10-15 02:50:55'),
(35, 18, 22, 50, 100, 45, 150, 120, 50, 1, 'pendekatan kepada masyarakat  sudah cukup baik, keterkaitan dengan tema proposal masih perlu di gali lagi karena masih belum tercantum adanya pemanfaatan tecnologi digital.', 'Pengajuan anggaran sudah cukup baik dan sesuai dengan produk yang akan di buat.', '2020-10-15 03:22:05', '2020-10-15 03:22:05'),
(36, 37, 22, 20, 40, 15, 25, 20, 10, 1, 'gagasan PASERAP : Pemanfaatan Aliran Sungai sebagai Sumber Energi Listrik untuk Penerangan Desa, cukup mengena bagi masyarakat di lingkungan sekitar, perencanaan kegiatan cukup terencana dengan baik.', 'sudah sesuai dengan kebutuhan', '2020-10-15 03:47:02', '2020-10-15 03:47:02'),
(37, 1, 22, 30, 100, 75, 125, 100, 50, 0, 'ide dan rancangan produk baik, namun untuk bisa masuk kemasyarakat sasar masih belum terlihat, dan pemberdayaan masayarakat sekitarnya.', 'anggaran lebih difokuskan dalam pembelian software , sehingga serapan dana kurang maxsimal, alangkah lebih baik dialokasikan ke fasilitas penunjang lainnya yang berfokus pada digital dan masyarakat.', '2020-10-15 05:26:49', '2020-10-15 05:26:49'),
(38, 25, 22, 50, 100, 75, 125, 100, 50, 1, 'tema digitalisasi belum terlihat, seharusnya ada sistem atau tema digital bisa dimasukan ke Tema aquascape, tidak hanya bahan dan material, teknologi pun bisa ditampilkan, semisal, pecahayaan pada penerang aquarium dengan cahaya yng dapat membantu pertumbuhan tanaman aquascape', 'anggaran sudah masuk dalam biaya (sesuai)', '2020-10-15 05:35:54', '2020-10-15 05:35:54'),
(39, 30, 22, 30, 60, 45, 74, 60, 50, 0, 'ide sangat baik, hanya saja konsen ke arah digital masih belum terlihat. serta jangka panjang dari program tersebut', 'anggaran sudah sesuai', '2020-10-15 05:42:34', '2020-10-15 05:42:34'),
(40, 5, 26, 30, 100, 90, 74, 100, 30, 1, '1. Judul terlalu panjang dan kurang memperhatikan kaidah B. Indonesia;\r\n2. Tidak memperhatikan kebutuhan Desa, tetapi digunakan untuk kebutuhan panti asuhan;\r\n3. Tidak melibatkan teknologi digital.', 'Tidak sesuai dengan program Innovillage', '2020-10-15 05:48:00', '2020-10-15 05:48:00'),
