(183, 175, 23, 10, 20, 15, 25, 20, 10, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. Hanya melakukan Perancangan Sistem Informasi Pendataan Siswa dan Guru Berbasis Website.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 11:53:44', '2020-10-15 11:53:44'),
(184, 184, 23, 20, 40, 75, 50, 20, 30, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. Hanya memberikan EXPERIMENT BOX UNTUK MENGATASI PERMASALAHAN PRAKTIKUM.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 11:57:32', '2020-10-15 11:57:32'),
(185, 188, 24, 10, 40, 30, 74, 20, 20, 1, 'Inovasi hanya untuk membantu pengisian air dan improvement dari penempelan label. \r\nTidak terlihat sustainability dan impact yg besar.', 'Beberapa Item seperti pen tablet wacom tidak ada relevansinya.\r\nPembuatan website juga 3,4jt bisa dioptimalkan menggunakan wordpress.', '2020-10-15 12:04:45', '2020-10-15 12:04:45'),
(186, 164, 24, 10, 40, 30, 50, 20, 20, 1, 'Inovasi pada pendinginan susu dan aplikasi dinilai perlu dilihat bagaimana pengembangan ke depannya.\r\nJika memang fokus di aplikasi, mengapa perlu membeli pendingin susu?', 'Besar di pembelian pendingin susu dan pembuatan aplikasi.', '2020-10-15 12:18:51', '2020-10-15 12:18:51'),
(187, 173, 24, 10, 20, 15, 25, 20, 10, 0, 'Hanya ada podcast bukan video, ide kurang jelas dan proposal hampir tidak ada isinya.\r\nHanya memberikan informasi menggunakan GMeet.', 'Tidak ada anggaran yg diajukan.', '2020-10-15 12:22:58', '2020-10-15 12:22:58'),
(188, 145, 24, 30, 60, 45, 125, 100, 30, 1, 'Sebenarnya hanya memberikan solusi penampungan air dan pengaliran menggunakan mikrokontroller.\r\nPerlu dipastikan apakah air benar-benar bisa mengalir di pipa dengan panjang 1km?\r\nImpactnya tidak besar, tetapi air adalah hal yg vital jika memang di lokasi tersebut sangat susah mendapatkan air.', 'Dipastikan harga pipa dan kebutuhan sambungan serta lemnya.', '2020-10-15 12:39:07', '2020-10-15 12:39:07'),
(189, 116, 24, 10, 40, 15, 50, 20, 20, 1, 'Tidak ada inovasi yang berimpact, hanya penggunaan teknologi dan dalam skala yg kecil.', 'Tidak ada anggaran yang diajukan.', '2020-10-15 12:42:47', '2020-10-15 12:42:47'),
(190, 128, 24, 20, 20, 30, 25, 20, 20, 1, 'Hanya pemanfaatan teknologi, belum ada inovasi yang berimpact berskala besar.', 'Tidak ada masukan untuk anggaran.', '2020-10-15 12:47:14', '2020-10-15 12:47:14'),
(191, 121, 24, 20, 60, 45, 125, 100, 30, 1, 'Belum terlihat model websitenya apakah LMS dsb. Jika memang benar-benar dapat di implementasikan diharapkan dapat berimpct secara luas.', 'Semestinya perlu di detailkan kebutuhan websitenya, tidak ada anggaran untuk hosting.', '2020-10-15 13:04:01', '2020-10-15 13:04:01'),
(192, 109, 24, 30, 100, 75, 125, 100, 30, 0, 'Program Bebras ini sudah international untuk meningkatkan literacy ICT untuk anak-anak, jika mampu diterapkan akan berimpact besar.', 'Anggaran perlu direview kembali, terlalu sedikit.', '2020-10-15 13:15:21', '2020-10-15 13:15:21');
INSERT INTO `tbl_nilai` (`Id`, `proposal_id`, `user_id`, `original`, `inovasi`, `kolaborasi`, `kebermanfaatan`, `sustainability`, `TTKI`, `video`, `komentar`, `anggaran`, `created_at`, `updated_at`) VALUES
(193, 97, 24, 30, 100, 45, 125, 60, 30, 1, 'Banyak solusi pengelolaan sampah menggunakan aplikasi, tetapi saat ini belum terlihat impact yg lebih besar dan sustain. \r\nPermasalahan mungkin terdapat pada sulitnya dalam memberikan sosialisasi terkait aplikasi dan programnya.', 'Anggaran perlu dilihat lagi, tidak perlu membeli mobile phone, fokus kepada aplikasi dan sosialisasinya.', '2020-10-15 13:28:11', '2020-10-15 13:28:11'),
(194, 85, 24, 30, 100, 75, 125, 60, 50, 1, 'Cukup menarik idenya, tetapi hanya bisa diterapkan pada 1 perahu/kapal saja sehingga impact tidak besar.', 'Anggaran sudah cukup/sesuai.', '2020-10-15 13:35:39', '2020-10-15 13:35:39'),
(195, 75, 24, 60, 140, 90, 175, 140, 60, 1, 'Inovasi bagus karena memberikan sumber air untuk masyarakat, tetapi perlu diberikan tambahan inovasi teknologi sensor dsb.', 'Anggaran sudah sesuai.', '2020-10-15 13:42:00', '2020-10-15 13:42:00'),
(196, 51, 24, 30, 120, 75, 175, 120, 50, 0, 'Inovasi yg sudah umum, tetapi tetap diperlukan karena sampah plastik ada dimana-mana.\r\nPerlu integrasi dengan Bank Sampah untuk mengumpulkan sampah plastik bekas.', 'Anggaran cukup, perlu diperiksa harga mesin diesel dan pencacah.', '2020-10-15 13:54:06', '2020-10-15 13:54:06'),
(197, 32, 24, 30, 60, 30, 50, 40, 20, 0, 'Inovasi bagus, tetapi impact tidak bisa luas.\r\nMungkin lebih fokus ke inovasi hasil produk atau ke mesin pembuatan kemasannya.', 'Desain grafis, Dokumentasi, Purwarupa dan Presentasi Penyuluhan sepertinya mengambil banyak porsi anggaran yang perlu di detailkan kembali apa saja komponen di dalamnya.', '2020-10-15 14:03:24', '2020-10-15 14:03:24'),
(198, 3, 24, 30, 120, 75, 175, 100, 30, 1, 'Umum diperlukan di masyarakat untuk mengolah sampah.\r\nOutput dari olahan perlu diberikan inovasi.', 'Perlu di detailkan biaya untuk Pembelian mesin daur ulang sampah, bahan baku pengembangan mesin dan bahan baku pembuatna produk.', '2020-10-15 14:06:20', '2020-10-15 14:06:20'),
(199, 153, 20, 30, 60, 75, 74, 100, 30, 1, 'Tidak cocok untuk innovillage, tidak ada inovasinya.', 'Tidak direkomendasikan', '2020-10-15 15:09:25', '2020-10-15 15:09:25'),
(200, 157, 20, 70, 140, 90, 175, 140, 70, 1, 'Video dan proposal dibuat dengan baik. RAB rinci.\r\nPermasalahan dan solusi sudah sesuai.', 'Cukup', '2020-10-15 15:33:31', '2020-10-15 15:33:31'),
(201, 160, 20, 50, 120, 90, 125, 100, 50, 0, 'Link tidak mengarah ke video. Proposal kurang tajam. Desa sasar tidak jelas, analisis masalah kurang tajam. Solusi juga terlalu umum.', 'Tidak direkomendasikan', '2020-10-15 15:45:19', '2020-10-15 15:45:19'),
(202, 169, 20, 50, 120, 90, 150, 120, 50, 1, 'Proposal tidak dibuat dengan baik. Masalah kurang tajam. Solusi tidak meyakinkan manfaat dan hubungannya dengan masalah.', 'Tidak direkomendasikan', '2020-10-15 15:48:14', '2020-10-15 15:48:14'),
(203, 3, 19, 30, 100, 30, 125, 40, 30, 1, 'Untuk video, harusnya bukan menjelaskan isi proposal tapi menjelaskan bagaimana proses daur ulang sampah di Bank Sampah dilakukan saat ini.\r\nProposalnya agak menyesatkan dan terkesan memaksakan. Inti kegiatan adalah aktivitas redesign, pembelian dan pemanfaatan mesin daur ulang tidak dijelaskan detail.', 'sudah pas', '2020-10-15 15:51:34', '2020-10-15 15:51:34'),
(204, 5, 21, 30, 100, 30, 125, 60, 30, 1, 'tidak terdapat contoh desain masker yg akan dibuat', '10 juta', '2020-10-15 15:51:42', '2020-10-15 15:51:42'),
(205, 10, 19, 10, 100, 30, 125, 20, 50, 0, 'penyuluhan itu biasa, akan luar biasa kalau ada alat peraga digital atau cara penyuluhannya menggunakan teknologi digital.', 'sudah pas', '2020-10-15 15:55:38', '2020-10-15 15:55:38'),
(206, 172, 20, 70, 140, 90, 175, 120, 60, 1, 'Jika memang diperlukan untuk para pekerja migran, maka ide nya menarik dan bermanfaat.\r\nLakukan pengukuran sebelum vs sesudah untuk mengevaluasi keberhasilan solusi yang diimplementasikan terhadap permasalahan yang dipecahkan.', 'Biaya sebaiknya diprioritaskan untuk pembuatan solusi yang ditawarkan. Biaya seperti seragam, banner, dsj, dikonversi ke biaya development, atau dikurangi saja.', '2020-10-15 16:00:03', '2020-10-15 16:00:03'),
(207, 218, 21, 50, 100, 45, 125, 100, 50, 1, 'Cukup dengan menyimpan sensor pada titik tertentu saja, sehingga hasilnya real time tiap saat', '15.500.000', '2020-10-15 16:00:52', '2020-10-15 16:00:52'),
(208, 181, 20, 10, 20, 15, 25, 20, 10, 0, 'Double submission. Silakan lihat penilaian di proposal satunya.', 'Double submission. Silakan lihat penilaian di proposal satunya.', '2020-10-15 16:02:03', '2020-10-15 16:02:03'),
(209, 184, 20, 70, 140, 90, 150, 140, 60, 1, 'Video seadanya.\r\nIde menarik jika memang diperlukan oleh sekolah tersebut. Dapat dikembangkan menjadi startup supaya lebih luas.\r\nAspek digital agak kurang.\r\nLakukan pengukuran sebelum vs sesudah untuk mengevaluasi keberhasilan solusi yang diimplementasikan terhadap permasalahan yang dipecahkan.', 'Sudah cukup', '2020-10-15 16:04:37', '2020-10-15 16:04:37'),
(210, 193, 20, 50, 100, 90, 125, 100, 30, 0, 'Urgensi/masalah tidak meyakinkan. \r\nSolusi sejenis sudah ada.', 'Tidak ada RAB', '2020-10-15 16:08:10', '2020-10-15 16:08:10'),
(211, 196, 20, 60, 120, 90, 150, 120, 60, 1, 'Solusi mungkin bermanfaat dan sesuai permasalahan masyarakat sasar, namun pemaparan di proposal kurang baik sehingga analisis masalah dan solusi sulit dipahami dengan baik. Fitur-fitur solusi yang ditawarkan tidak dijelaskan dengan baik.\r\nLakukan pengukuran sebelum vs sesudah untuk mengevaluasi keberhasilan solusi yang diimplementasikan terhadap permasalahan yang dipecahkan.', 'Cukup', '2020-10-15 16:19:45', '2020-10-15 16:19:45'),
(212, 205, 20, 70, 140, 105, 175, 140, 70, 1, 'Video dan proposal cukup baik. Solusi yang ditawarkan baik dan bermanfaat.\r\nLakukan pengukuran sebelum vs sesudah untuk mengevaluasi keberhasilan solusi yang diimplementasikan terhadap permasalahan yang dipecahkan.', 'Cukup', '2020-10-15 16:23:05', '2020-10-15 16:23:05'),
(213, 208, 20, 50, 100, 90, 125, 100, 50, 0, 'Kegiatan penyuluhan kurang inovatif, tidak cocok untuk innovillage.', 'Terlalu mahal untuk kegiatan penyuluhan.\r\nBiaya tempat sampah terlalu besar, tidak berhubungan langsung dengan kegiatan penyuluhan itu sendiri.', '2020-10-15 16:28:39', '2020-10-15 16:28:39'),
(214, 217, 20, 50, 100, 90, 125, 100, 50, 1, 'Video seadanya.\r\nUrgensi masalah dan kebermanfaatan solusi tidak nampak.', 'Cukup', '2020-10-15 16:30:38', '2020-10-15 16:30:38'),
