(221, 253, 20, 50, 100, 90, 150, 100, 50, 1, 'Video seadanya.\r\nProposal tidak disusun dengan baik.\r\nSolusi kurang inovatif, dan tidak terlihat urgensi masalahnya.', 'Tidak direkomendasikan', '2020-10-15 16:55:47', '2020-10-15 16:55:47'),
(222, 138, 22, 50, 100, 75, 125, 100, 50, 1, 'Cakupan masih kurang luas, kurang memberdayakan masayarakat sekitar, tema digital sudah ada, namun masih belum ada sesuatu hal yang baru.', 'anggaran ideal di bawah 10 juta rupiah', '2020-10-15 17:01:52', '2020-10-15 17:01:52'),
(223, 143, 22, 50, 100, 75, 74, 60, 50, 1, 'ide cukup bagus, hanya perlulingkup yang lebih besar sesuai tema yang ada di Innovillage', 'anggran masih terlalu rendah, ideal di angka 5 juta rupiah', '2020-10-15 17:06:50', '2020-10-15 17:06:50'),
(224, 150, 22, 50, 100, 75, 125, 60, 50, 1, 'Lebih dominan di aksi sosialnya, belum terlihat , tema digitalisasi untuk desa sebagai pelengkapnya.', 'dana yang diajukan sudah sesuai', '2020-10-15 17:09:46', '2020-10-15 17:09:46'),
(225, 155, 22, 50, 100, 75, 74, 60, 20, 1, 'Masih belum lengkap proposalnya, anngran biaya belum ada, idenya sudah cukup bagus, tujuan kolaborasi dan berkelompok', 'belum ada', '2020-10-15 17:14:05', '2020-10-15 17:14:05'),
