(229, 174, 22, 30, 60, 45, 125, 60, 20, 1, 'proposal belum lengkap.', 'anggran belum ada', '2020-10-15 17:35:02', '2020-10-15 17:35:02'),
(230, 187, 23, 50, 100, 15, 74, 100, 30, 1, '1. Antara judul dan proposal yang ditulis tidak selaras. Dimana judul membuat vending machine dan proposal menyebutkan aplikasi Android.\r\n2. Sistem perancangan yang akan dibangun belum ada di proposal, ataupun gambaran singkat dari si vending machine.\r\n3. Dari anggaran yang diajukan juga hanya Galon dan dan Vending Machine yang sudah jadi.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 17:35:33', '2020-10-15 17:35:33'),
(231, 258, 22, 30, 60, 75, 125, 60, 10, 0, 'Proposal belum lengkap, tujuan sudah terlihat', 'belum ada', '2020-10-15 17:37:28', '2020-10-15 17:37:28'),
(232, 255, 22, 70, 140, 105, 175, 140, 70, 1, 'Bagus, ide bisa diimplementasikan, tujuan besar irigasi sangat bermanfaat untuk kebutuhan pengairan dan perkebunan', 'Dana yang diajukan sudah ideal (sesuai)', '2020-10-15 17:40:27', '2020-10-15 17:40:27'),
(233, 196, 23, 50, 100, 15, 74, 60, 30, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. Hanya membuat aplikasi iuran.\r\n\r\nReviewer mengusulkan (mungkin) dapat dipertimbangkan.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer memberikan rekomendasi sebesar Rp. 5.000.000,- (maksimal)', '2020-10-15 17:43:32', '2020-10-15 17:43:32'),
(234, 246, 22, 70, 140, 105, 175, 140, 70, 1, 'Ide sangat Bagus, dapat diimplementasikan.', 'anggran belum terlihat', '2020-10-15 17:44:56', '2020-10-15 17:44:56'),
(235, 199, 23, 10, 20, 15, 25, 20, 10, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. hanya menggunakan simple aplikasi untuk sosialisasi pembelajaran online.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 17:45:52', '2020-10-15 17:45:52'),
(236, 243, 22, 70, 140, 105, 175, 140, 70, 1, 'Keren, sesuai dengan tema Innovillage, Proposal dapat dilanjutkan', 'Anggran terlalu kecil, ideal di 10 juta rupiah', '2020-10-15 17:47:09', '2020-10-15 17:47:09'),
(237, 208, 23, 10, 20, 15, 25, 20, 10, 0, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. hanya berupa sosialisasi, bagi-bagi masker dan hand sanitizer.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 17:53:54', '2020-10-15 17:53:54'),
(238, 211, 23, 60, 120, 15, 125, 120, 60, 1, '1. Ide sangatlah cocok dengan tema innovillage.\r\n2. Ada potensi dana dapat diperbesar jika sistem yang dibangun sangatlah kompleks dan menarik.\r\n3. Pertimbangan reviewer adalah apakah ini dapat selesai dalam jangka waktu yang sangat singkat.\r\n\r\nReviewer agar diterima', 'Reviewer memberikan rekomendasi sebesar Rp. 2x.xxx.xxx,- (minimal Rp. 20.000.000,-)', '2020-10-15 17:58:49', '2020-10-15 17:58:49'),
(239, 220, 23, 10, 20, 15, 25, 20, 10, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. hanya berupa penyuluhan tidak ada kontribusi yang jelas bagi desa.\r\n\r\nReviewer mengusulkan agar ditolak.', 'Reviewer tidak memberikan rekomendasi anggaran (Rp. 0,-)', '2020-10-15 18:01:27', '2020-10-15 18:01:27'),
(240, 261, 25, 10, 20, 15, 25, 20, 10, 1, 'Proposal tidak sesuai dengan judul', 'Tidak direkomendasikan lolos', '2020-10-15 18:05:21', '2020-10-15 18:05:21'),
(241, 223, 23, 50, 100, 15, 125, 100, 30, 1, '1. Ide bagus, namun ada beberapa hal yang tidak silaras antara video dengan proposal yang ditulis.\r\n2. Di Video menyebutkan IoT, namun di proposal tidak menemukan perancangan sistem yang akan dibangun, ataupun perangkat-perangkat yang berkenaan dengan IoT seperti sensor, dll.\r\n3. Android begitu kompleks, namun di proposal terlalu simple.\r\n\r\nReviewer mengusulkan agar dipertimbangkan (50/50)', 'Reviewer memberikan rekomendasi sebesar Rp. 10.000.000,- (maksimal)', '2020-10-15 18:06:43', '2020-10-15 18:06:43'),
(242, 4, 25, 20, 60, 30, 74, 40, 20, 1, 'Todal menjelaskan dengan detail design masker yang akan dibuat dan tidak dilengkapi dengan deskripsi yang menjelaskan apa perbedaan masker yang dibuat dengan yang sudah banyak beredar di pasaran.', '-', '2020-10-15 18:07:11', '2020-10-15 18:07:11'),
(243, 232, 23, 10, 20, 15, 25, 20, 10, 1, '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. hanya sosialisasi Ms. Office.\r\n\r\nReviewer mengusulkan agar ditolak.', '1. Nampaknya judul dan isi tidak sesuai dengan tema innovillage\r\n2. hanya membuat poster promosi.\r\n\r\nReviewer mengusulkan agar ditolak.', '2020-10-15 18:08:32', '2020-10-15 18:08:32'),
(244, 9, 25, 20, 60, 30, 74, 40, 20, 0, 'Kegiatan yang dilakukan lebih ke bentuk kegiatan bakti sosial. Tidak terdapat gagasan inovasi yang menjadi solusi jangka panjang dari permasalahan masy. sasar yang dicantumkan pada proposal. Proposal tidak ditulis dengan baik, beberapa bagian masih mencantumkan deskripsi sub-bab pada proposal.', 'Anggaran yang diajukan terlalu besar.', '2020-10-15 18:13:10', '2020-10-15 18:13:10'),
(245, 91, 18, 60, 120, 45, 150, 120, 30, 1, 'Inovasi yang melibatkan teknologi digital sudah baik.\r\nDetail diagram teknologi perlu dijabarkan.', 'Sesuai', '2020-10-15 18:15:10', '2020-10-15 18:15:10'),
(246, 98, 18, 30, 40, 15, 50, 40, 20, 1, 'Penerapan teknologi digital dijelaskan dengan baik.\r\nKeterlibatan masyarakat desa sasar secara aktif tidak muncul.\r\nAkan lebih baik jika disasarkan di desa kategori 3T (di proposal ditujukan untuk perkotaan).', 'N/A', '2020-10-15 18:20:51', '2020-10-15 18:20:51'),
