(573, 189, 25, 60, 120, 45, 150, 100, 50, 1, 'Anggota tim berasal dari akuntansi namun program yang diusulkan berbasis pengembangan IT untuk wisata. Akan lebih baik jika anggota tim juga melibatkan mahasiswa IT sehingga pengembangan IT tidak sepenuhnya dilakukan outsource (dan menghabiskan hampir 80% dari anggaran yang diajukan). Perlu dijelaskan pula bagaimana aplikasi ini akan membantu Desa Wisata menjadi lebih sejahtera dan mandiri.', 'Sesuai dengan yang diajukan, namun dapat kembali disesuaikan.', '2020-10-16 05:05:30', '2020-10-16 05:05:30'),
(574, 185, 20, 60, 120, 90, 150, 120, 60, 1, 'Mesin touchwash baik dan bermanfaat, sedangkan pembagian masker tidak perlu (tidak cocok) untuk innovillage.\r\nAkan tetapi, tidak jelas kompetensi tim untuk membangun mesin touchwash. \r\nRAB juga masih belum terinci dengan baik, sehingga tidak tampak justifikasi nilai yang diajukan.', 'RAB belum dirinci dengan baik. Belum bisa ditentukan berapa biaya yang layak.', '2020-10-16 05:08:16', '2020-10-16 05:08:16'),
(575, 198, 25, 60, 120, 75, 150, 100, 60, 1, 'Perlu ditambahkan pada proposal mengenai skema penyaluran dana yang didapatkan dari aplikasi dengan lebih jelas, dan bagaimana kemudia masyarakat akan mengelola aplikasi tersebut secara mandiri.', 'Sesuai dengan pengajuan.', '2020-10-16 05:23:08', '2020-10-16 05:23:08'),
(576, 201, 25, 50, 120, 75, 175, 100, 70, 1, 'Proposal dan video mendeskripsikan program dengan baik.', 'Sesuai dengan yang diajukan.', '2020-10-16 05:28:07', '2020-10-16 05:28:07'),
