(578, 213, 25, 30, 60, 45, 125, 60, 30, 0, 'Video yang diupload tidak sesuai dengan proposal yang diajukan. Program tidak menyasar Desa tetapi SMA.', 'Anggaran hanya mencantumkan bahan bakar motor dan biaya poster.', '2020-10-16 05:34:53', '2020-10-16 05:34:53'),
