(580, 174, 25, 30, 60, 45, 74, 40, 30, 1, 'Rancangan kegiatan sosialisasi poster tidak dijelaskan pada proposal. Melihat pada permasalahan yang diungkapkan, masalah dari masy. sasar bukanlah pada konten poster tapi pada sosialisasi. Masy. sasar juga belum ditentukan secara spesifik. Tidak menyasar pada desa tertentu, sehingga tidak terlihat kontribusi yang dapat diberikan pada pengembangan Desa.', 'Anggaran tidak selesai dibuat.', '2020-10-16 05:43:49', '2020-10-16 05:43:49'),
