(582, 177, 25, 60, 120, 90, 175, 120, 60, 1, 'Program yang diusulkan merupakan program yang jarang diperhatikan oleh berbagai pihak, demikian jika program ditambahkan produk inovasi yang kemudian dapat diaplikasikan di berbagai Desa TKI akan sangat baik. Desa yang menjadi masy. sasar yang dipilih dapat menjadi Desa percontohan untuk pengembangan program lain untuk kesejahteraan mantan TKI Indonesia.', 'Sesuai dengan pengajuan.', '2020-10-16 05:49:02', '2020-10-16 05:49:02'),
